> Top News Obama focusing on condolences, not gun laws, in Oregon visit President Barack Obama walks with Oregon Gov. Kate Brown prior to their short motorcade ride to Roseburg H.S., Friday, Oct. 9, 2015 in Roseburg, Ore. Obama traveled to Roseburg to meet with families of the victims of the Oct. 1, shooting at Umpqua Community College, as part of a four-day West Coast tour. Obama is also scheduled to attend a fundraiser event later today in Seattle with Sen. Patty Murray, D-Wash. He's is also attending fundraisers in San Francisco and Los Angeles during the four-day visit. (AP Photo/Pablo Martinez Monsivais) 
